import React from "react";
import ProductList from "../Products/ProductList";
import Footer from "../Footer";
import Logo from "../Logo/Logo";
import images from "../../Data/images.json";
import Cart from "./Cart";

export default function Shop(props) {
  const { products } = props;
  const { stock } = props;
  return (
    <>
      <div id="shop-logo">
        <Logo />
        <Cart />
      </div>

      <div className="shop-page">
        <nav className="shop-tabs">
          <a href="shop/jackets">jackets</a>
          <a href="shop/hats\accessories">hats/accessories</a>
          <a href="shop/tops\sweaters">tops/sweaters</a>
          <a href="shop/shirts">shirts</a>
          <a href="shop/pants">pants</a>
        </nav>
      </div>

      <ProductList product={products} stock={stock} />
      <Footer className="sticky" />
    </>
  );
}
